import http from '@core/services/http';
import { buildQueryString } from '@core/utils/url';
export default {
  fetchFulfillments: function fetchFulfillments(params) {
    return http.get("/fulfillments?".concat(buildQueryString(params)));
  },
  countFulfillments: function countFulfillments(params) {
    return http.get("/fulfillments/count?".concat(buildQueryString(params)));
  },
  exportFulfillments: function exportFulfillments(params) {
    return http.get("/fulfillments/export?".concat(buildQueryString(params)));
  }
};
